import { STATISTICAL_TOTAL_CLASS } from './../constants/types';

const initialState = {
    dataMonthCurrent: [],
    dataMonthLast: []
}
export default function(state = initialState, action) {
    switch(action.type)
    {
        case STATISTICAL_TOTAL_CLASS:
            return {
                ...state,
                dataMonthCurrent: action.payload.lopsMonthCurrent,
                dataMonthLast: action.payload.lopsMonthLast
            }
        default:
            return state;
    }
};
